import React from 'react'
import { Box, Typography, Grid, TextField, Paper, FormGroup } from '@mui/material'



export const Details = () => {
  return (
    <Box >
      <Grid container justifyContent={'center'}>
        <Grid item xs={4} md={8} sx={{ marginTop: 4, boxShadow: 'rgba(0, 0, 0, 0.35) 0px 5px 15px' }}>
          <Paper
            sx={{ padding: '10px', height: 'fit-content' }}
          >
            <form>
              <Typography >Create Account</Typography>
              <Box>
                <label>
                  <Typography
                    mt={2}
                    mb={1}
                    sx={{ fontSize: "17px", color: "#000" }}
                  >
                    <b> Description </b>
                  </Typography>
                </label>

                <input
                  rows={4}
                  cols={50}
                  placeholder="Max 500 Characters"
                  style={{
                    padding: "10px",
                    borderRadius: "5px",
                    width: "300px",
                    border: "1px solid #000",
                  }}
                />
              </Box>

              <Box>
                <label>
                  <Typography
                    mt={2}
                    mb={1}
                    sx={{ fontSize: "17px", color: "#000" }}
                  >
                    <b> Description </b>
                  </Typography>
                </label>

                <textarea
                  rows={4}
                  cols={50}
                  placeholder="Max 500 Characters"
                  style={{
                    padding: "10px",
                    borderRadius: "5px",
                    width: "300px",
                    border: "1px solid #000",
                  }}
                />
              </Box>




            </form>
          </Paper>
        </Grid>
      </Grid>

    </Box>
  )
}
